import React from 'react';
import {robots} from './robots.js';

const imgArr = [
	{img: '', text: '"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'},
	{img: '', text: '"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'},
	{img: '', text: '"The Harvesters" by Peter Bruegel, 1565 (Met Museum)'}
]

const num = () => {
	return Math.round(Math.random()*(imgArr.length-1));	
}

const Banner = (props) => {
	return (
		<div>
			<div id='spacer'>studio art resources</div>
			<div id='banner' title={imgArr[num()].text}></div>
		</div>
	);
}

export default Banner;
